import styled from "styled-components";
import { useEffect, useState } from "react";
import { getSomethingFromMyAPI } from "../src";

function Index() {
  const Paragraph = styled.p`
    color: red;
  `;
  const [data, setData] = useState({});

  useEffect(() => {
    getSomethingFromMyAPI().then(response => setData(response));
  }, [setData]);

  return (
    <div>
      <h1>Alo BEBE, QUE TENES PARA MI</h1>
      <Paragraph>{data.greeting || "Loading..."}</Paragraph>
    </div>
  );
}

export default Index;
